import Layout from "../components/Layout";
import Project from "../components/Project";

function HomePage() {
  return (
    <Layout>
      <h1>Check out my work</h1>
      <div>
        <Project />
      </div>
      <style jsx>
        {`
          display: grid;
          grid-template-column: repeat(auto-fill, minmax(25%, 1fr));
        `}
      </style>
    </Layout>
  );
}

export default HomePage;
